    description: "<body>\n\n\t\t\t\t\t\t\t\t<div style=\"position:absolute; top:0px; right:0px;\">\n                                  <img _title=\"This is a Popular File\" alt=\"\" class=\"ipsImage\" data-ipstooltip=\"\" src=\"https://www.simtropolis.com/library/misc/big-heart-icon.png\" style=\"\" width=\"34\" height=\"53\">\n\t\t\t\t\t\t\t\t</div>\n\n\n\n\n\n\n\n\n\n\n<p>\_</p>\n<p>\n</p>\n<p align=\"justify\">This is a collection of 7 container ship props to be used with the upcoming <span style=\"font-weight:bold;color:rgb(0,0,102);\"><abbr title=\"Pegasus\">PEG</abbr>-<abbr title=\"Coastal Development Kit 3\">CDK3</abbr> Seaport</span> (<abbr title=\"Coastal Development Kit 3\">CDK3</abbr>-SP) series of lots. It is a required dependency, specifically, for the Container Ship Seaport lot and may be used with other <span style=\"font-weight:bold;color:rgb(51,0,153);\"><abbr title=\"Coastal Development Kit 3\">CDK3</abbr>-SP</span> lots.</p>\n<p align=\"justify\">* Players and developers may use these props on their own lots... subject to the terms of the EULA that is documented in the included readme file.</p>\n<p style=\"text-align:center;\"><strong style=\"font-family:Roboto, sans-serif;line-height:22px;\"><span style=\"color:rgb(128,0,0);\">All Pegasus files are\_now legacy content and are no longer officially\_supported\_- however support from the wider community can be requested</span>\_<u><a style=\"color:rgb(51,122,183);\" href=\"https://community.simtropolis.com/forums/topic/68471-plex-on-the-stex-community-support/\" rel=\"\">here</a></u></strong>.</p>\n<p>\_</p>\n\n\t\t\t\t\t\t</body>"
